import React from 'react';
import Autocomplete from 'react-autocomplete';
import {updateTextType} from "../../../../redux/calculateFormReducer";

const CalculateForm =(props)=>{
    let width=(e)=>{
        props.updateTextWidth(e.target.value);
    }
    let height = (e)=>{
        props.updateTextHeight(e.target.value);
    }
    let lenght=(e)=>{
        props.updateTextLenght(e.target.value);
    }
    let weight=(e)=>{
        props.updateTextWeight(e.target.value);
    }
    let quantity=(e)=>{
        props.updateTextQuantity(e.target.value);
    }
    let comment=(e)=>{
        props.updateTextComment(e.target.value);
    }
    let type=(e)=>{
        props.updateText('')
    }
    return <div>
        <input placeholder={'Ширина'}/>
        <input placeholder={'Высота'}/>
        <input placeholder={'Длина'}/>
        <input placeholder={'Вес'}/>
        <input placeholder={'Количество'}/>
        <input placeholder={'Комментарий'}/>
        <button>Отправить</button>
    </div>

}
export default CalculateForm;
